import { Outlet, Navigate } from "react-router-dom";
// import Login from './Components/Login'
const PrivateRoutes = () => {
  let auth = { token: True };
  return auth.token ? <Outlet /> : <Navigate to="./Components/Login" />;
};
export default PrivateRoutes;
